globdecl.text:
color INT = int timed;
color DATA = string;
color INTxDATA = product INT * DATA;
var n, k : INT;
var p,str : DATA;
val stop = "########";

color Ten0 = int with 0..10;
color Ten1 = int with 1..10 declare ran;
var s : Ten0; var r:Ten1;
fun OK(s:Ten0,r:Ten1) = (r<=s);

color NetDelay = int with 25..75 declare ran;
fun DEL() = ran'NetDelay();
var wait : TIME;

