action
if n=k then
  (if n=1 then line_no := !line_no + 1 else ();
    CPNChart.LC_upd_chart_int{
        lc = "Line Chart 0",
        values = [(1, IntInf.toInt(time()), !line_no,
                   if n=1 then false else true, true)]};
    CPNChart.LC_upd_chart_int{
        lc = "Line Chart 1",
        values = [(1, step(), !line_no,
                   if n=1 then false else true, true)]})
else ();
